import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Form from 'react-bootstrap/Form';

import '../UserAccount/login.css';

//import logo from '../Images/clubhouse.jpg';


function Login(){

    window.onload = function () {
        document.getElementsByClassName('.smart-living, .footer, sidenav_sidenav__3d27F').style.display = 'none';
    };
    

    // Axios - Sign in 
    useEffect(() => {
        axios.post('https://localhost:44311/api/controller/login' , { email: "" , password: ""})
          .then(response => {
            //setTests(response.data);
            console.log("Sign in Successful" + response.data);
            console.log("Api Works");
          })
          .catch(error => {
             console.error(error);
             console.log("Api Not Working" );
          });
      },[]);

    return(
        <div className="container bodyContainer"> 
            <div className="center">
                <Form>
                    <Form.Group className="mb-3" controlId="formBasicName">
                        <Form.Label> Username </Form.Label>
                            {/*<Form.Control onChange={this.handleChange} type="text" placeholder="Enter your name" />*/}
                        <Form.Control type="text" placeholder="Enter your name" />
                    </Form.Group>

                    <Form.Group className="mb-3" controlId="formBasicLastName">
                        <Form.Label> Password</Form.Label>
                            {/*<Form.Control onChange={this.handleChange} type="text" placeholder="Enter your name" />*/}
                        <Form.Control type="text" placeholder="Enter your name" />
                    </Form.Group>

                    <Button variant="primary" type="submit" className="btn-large">  Login </Button>
                </Form>
            </div>
        </div>
    )
}

export default Login;
